import React from 'react';

interface VideoCardProps {
    song: {
        id: string;
        title: string;
        thumbnailUrl: string;
        artist: string;
    };
}

const VideoCard: React.FC<VideoCardProps> = ({ song }) => {
    return (
        <div className="video-card">
            <img src={song.thumbnailUrl} alt={song.title} />
            <h3>{song.title}</h3>
        </div>
    );
};

export default VideoCard;
